import React from "react"

function Badge(props) {
    return (
        <p>
            Name: {props.data}
            {props.lastName}
            {props.email}
            {props.placeOfBirth}
            {props.phoneNumber}
            {props.favFood}
            {props.infoBox}


        </p>
    )

}

export default Badge
